/**
    定义fi=SIGMA{divmed(j)}，j从1到i
    divmed(x)表示x的约数的中位数，偶数个的话选择靠前的
    例如10的约数是1/2/5/10，所以divmed(10)=2
    divmed(100)=10
    因此divmed(x)就是比sqrt(x)小的最大的约数
    一共有n个东西，第i个东西上有一个数fi
    一共有m天，第i天执行如下操作：
    将pi的倍数全部拿走，然后剩下的依次从1重新编号
    问m天后，剩下的第k个东西上的数是多少
    n/k都在1E10,m在10万

    首先考虑如何把m个pi的倍数全部去掉，直接减即可
    可以使用二分搜索得到全部剪完之后的第k个数是多少.

    然后考虑打表fi，fi一共有1E10个，显然太多
    令Gi = f(200万×i)，则G一共有5000个，可以打出来。
    注意到每一个fi都是i的平方因子以下的因数，因此可以使用筛法
    实际上Gi保存的是每一段的和，所以真正的f(200万×i)需要累加G

    最后对每一个所求的k，首先找离他最近的节点，然后加或者减即可。
    最差情况下，100万×log(sqrt(1E10))。
*/
#include <bits/stdc++.h>
using namespace std;
typedef long long llt;

//筛法
llt const LIMIT = 100000;
llt const INTER = 2000000LL;
llt P[INTER];

//筛出[(idx-1)INTER-1,idx*INTER]之间所有的divmed
//注意到divmed不会超过sqrt
void sieve(llt index){
    llt end = index * INTER;
    llt start = end - INTER + 1;
    fill(P,P+INTER+1,1LL);

    for(llt i=2;i<=LIMIT&&i*i<=end;++i){
        //计算起点
        llt b = start / i * i;
        if(b<start) b += i;
        if(b<i*i) b = i * i;
        for(llt j=b;j<=end;j+=i){
            P[j%INTER] = i;//P[end]实际上保存在P[0]中
        }
    }
}

void dabiao(ostream&os){
    //os<<"llt const G[] = {0";
    for(llt index=2850,n=10000000000/INTER;index<=n;++index){
        //cout<<"第"<<index<<": ";
        sieve(index);
        //求和
        llt sum = accumulate(P,P+INTER,0LL);
        os<<","<<sum;
        //cout<<sum<<endl;
    }
    os<<"}"<<endl;
}

llt N,K;
int M;
llt A[100010];

//n减去所有A中的数的倍数，是否比K不小
bool check(llt n){
    for(int i=0;i<M;++i) n -= n / A[i];
    return n >= K;
}

